import React, { useState } from "react";
import { useNavigate } from 'react-router-dom'; 
import { Icon } from 'react-icons-kit';
import { eyeOff } from 'react-icons-kit/feather/eyeOff';
import { eye } from 'react-icons-kit/feather/eye';
import * as Components from './Components'; // Assuming you have your styled components defined in a separate file

function Doctor() {
    const navigate = useNavigate();

    // State for registration form
    const [registrationData, setRegistrationData] = useState({
        name: '',
        email: '',
        phoneNumber: '',
        location: '',
        yearsOfService: '',
        password: '',
        confirmPassword: ''
    });

    // State for login form
    const [loginData, setLoginData] = useState({
        email: '',
        password: ''
    });

    // Toggle state for showing password
    const [showPassword, setShowPassword] = useState(false);

    // Toggle between sign up and sign in views
    const [signIn, toggleSignIn] = useState(true);

    // Function to toggle password visibility
    const handleTogglePassword = () => {
        setShowPassword(!showPassword);
    };

    // Handle form input changes
    const handleInputChange = (event, formType) => {
        const { name, value } = event.target;
        if (formType === 'registration') {
            setRegistrationData({ ...registrationData, [name]: value });
        } else if (formType === 'login') {
            setLoginData({ ...loginData, [name]: value });
        }
    };

    // Handle registration form submission
    const handleRegistrationSubmit = (event) => {
        event.preventDefault();
        console.log('Registration Form Data:', registrationData);

        // Here you can perform validation and submit logic

        navigate('/success'); // Redirect to success page after registration

        // Clear registration form data after submission
        setRegistrationData({
            name: '',
            email: '',
            phoneNumber: '',
            location: '',
            yearsOfService: '',
            password: '',
            confirmPassword: ''
        });
    };

    // Handle login form submission
    const handleLoginSubmit = async (event) => {
        event.preventDefault();
        console.log('Login Form Data:', loginData);

        try {
            const response = await fetch('/login/doctor', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(loginData),
            });

            if (response.ok) {
                // handle successful response
                alert("Login successful");
                navigate('/successlogin'); // Redirect to success login page
            } else {
                // handle error response
                alert("Login failed");
            }
        } catch (error) {
            console.error('Error submitting form:', error);
            alert("An error occurred");
        }

        // Clear login form data after submission
        setLoginData({
            email: '',
            password: ''
        });
    };

    return (
        <Components.Container>
            <Components.SignUpContainer signinIn={signIn}>
                <Components.Form style={{ width: '320px' }} onSubmit={handleRegistrationSubmit}>
                    <Components.Title>Registration form Doctor</Components.Title>
                    {/* Registration form inputs */}
                    <Components.Input
                        type='text'
                        name='name'
                        value={registrationData.name}
                        placeholder='Name'
                        style={{ width: '100%' }}
                        onChange={(e) => handleInputChange(e, 'registration')}
                    />
                    {/* Other registration inputs */}
                    {/* Password input with show/hide functionality */}
                    <div style={{ position: 'relative', width: '100%' }}>
                        <Components.Input
                            type={showPassword ? 'text' : 'password'}
                            name='password'
                            value={registrationData.password}
                            placeholder='Password'
                            style={{ width: '100%' }}
                            onChange={(e) => handleInputChange(e, 'registration')}
                        />
                        <Icon
                            icon={showPassword ? eyeOff : eye}
                            onClick={handleTogglePassword}
                            style={{
                                position: 'absolute',
                                top: '50%',
                                right: '10px',
                                transform: 'translateY(-50%)',
                                cursor: 'pointer'
                            }}
                        />
                    </div>
                    {/* Other registration inputs */}
                    <Components.Button type='submit' style={{ width: '100%' }}>Sign Up</Components.Button>
                </Components.Form>
            </Components.SignUpContainer>

            <Components.SignInContainer signinIn={signIn}>
                <Components.Form onSubmit={handleLoginSubmit}>
                    <Components.Title>Log in</Components.Title>
                    {/* Login form inputs */}
                    <Components.Input
                        type='email'
                        name='email'
                        value={loginData.email}
                        placeholder='Email'
                        onChange={(e) => handleInputChange(e, 'login')}
                    />
                    {/* Password input with show/hide functionality */}
                    <div style={{ position: 'relative', width: '100%' }}>
                        <Components.Input
                            type={showPassword ? 'text' : 'password'}
                            name='password'
                            value={loginData.password}
                            placeholder='Password'
                            style={{ width: '100%' }}
                            onChange={(e) => handleInputChange(e, 'login')}
                        />
                        <Icon
                            icon={showPassword ? eyeOff : eye}
                            onClick={handleTogglePassword}
                            style={{
                                position: 'absolute',
                                top: '50%',
                                right: '10px',
                                transform: 'translateY(-50%)',
                                cursor: 'pointer'
                            }}
                        />
                    </div>
                    {/* Forgot password link */}
                    <Components.Anchor href='#'>Forgot your password?</Components.Anchor>
                    <Components.Button type='submit'>Submit</Components.Button>
                </Components.Form>
            </Components.SignInContainer>

            {/* Overlay container for sign in/up toggle */}
            <Components.OverlayContainer signinIn={signIn}>
                <Components.Overlay signinIn={signIn}>
                    <Components.LeftOverlayPanel signinIn={signIn}>
                        <Components.Title>Welcome Back To SISAC!</Components.Title>
                        <Components.Paragraph>
                            To keep connected with us please login with your personal info
                        </Components.Paragraph>
                        {/* Toggle to sign in view */}
                        <Components.GhostButton onClick={() => toggleSignIn(true)}>
                            Sign In
                        </Components.GhostButton>
                    </Components.LeftOverlayPanel>

                    <Components.RightOverlayPanel signinIn={signIn}>
                        <Components.Title>Hello, Doctor!</Components.Title>
                        <Components.Paragraph>
                            Enter Your personal details and start journey with us
                        </Components.Paragraph>
                        {/* Toggle to sign up view */}
                        <Components.GhostButton onClick={() => toggleSignIn(false)}>
                            Sign Up
                        </Components.GhostButton> 
                    </Components.RightOverlayPanel>
                </Components.Overlay>
            </Components.OverlayContainer>
        </Components.Container>
    );
}

export default Doctor;
